import React from "react";

function Login(){
    return(
        <div className="login-container">
            <div className="form-container">
                <h2 className="login-text"></h2>
                <form>
                    <div className="input-group">
                        <label htmlFor="username">User Name</label>
                        
                    </div>
                </form>
            </div>
        </div>

    );

}

export default Login;
